import React from 'react';

import classes from './HomePage.css';

const homepage = (props) => {

    let attachedClasses = [classes.HomePage, classes.Close];
    if (props.open) {
        attachedClasses = [classes.HomePage, classes.Open];
    }

    return (
        <div className={attachedClasses.join(' ')}>
            <h2>The eternal recipe for</h2>
            <h1>Success</h1>
            <h2>Is to don't stop learn and improve! </h2>
        </div>
    );
};

export default homepage;
